// src/Planner.js
import React from 'react';
import SearchBar from './SearchBar';

const Planner = ({ username }) => {
  const data = [
    'Apple',
    'Banana',
    'Cherry',
    'Date',
    'Elderberry',
    'Fig',
    'Grape',
  ];

  return (
    <div>
      <SearchBar data={data} username={username} />
    </div>
  );
};

export default Planner;
